Let's solve this step by step:

Statement 1: (ab)^{-2} = b^{-2}a^{-2}
• In a group, inverses have specific algebraic properties
• Let's verify: (ab)^{-2} means (ab)^{-1} * (ab)^{-1}
• This is equivalent to (ab)^{-1} * (ab)^{-1}
• Recall that (ab)^{-1} = b^{-1}a^{-1}
• So (ab)^{-2} = [b^{-1}a^{-1}][b^{-1}a^{-1}]
• In general, this doesn't equal b^{-2}a^{-2}
• Therefore, Statement 1 is FALSE

Statement 2: (ab)^n = a^nb^n
• This is false for all groups
• In general, (ab)^n ≠ a^nb^n
• Group elements do not always commute
• Therefore, Statement 2 is also FALSE

Since both statements are false, the answer is:

